INSERT INTO `product` (`id`, `name`, `category_id`, `code`, `price`, `availability`, `brand`, `image`, `description`, `is_new`, `is_recommended`, `status`) VALUES
(34, '\r\nПижамная рубашка классического кроя с геометрическим принтом ASOS DESIGN', 19, 1529051, 1690, 4, ' ASOS DESIGN', '', 'Мягкая ткань\r\nЛегкая и мягкая ткань Lenzing™ EcoVero™ из переработанных материалов\r\nИзготовлена из древесины искусственно выращенных лесов\r\nПолностью прозрачная цепочка поставок\r\nТакой процесс сокращает объемы использования воды и выбросов парниковых газов на 50%\r\n\r\nОсновная часть: 100% вискоза.', 0, 0, 1),
(35, 'Белое платье мини А-силуэта с запахом и вышивкой ришелье ASOS DESIGN', 19, 1581243, 2690, 3, 'ASOS DESIGN', '', 'Вышивка ришелье\r\nМы сотрудничаем с Better Cotton Initiative для повышения качества производимого хлопка в глобальном масштабе\r\nЭто обеспечивает лучшие условия для фермеров и окружающей среды\r\nBCI проводит специальные обучающие тренинги для фермеров\r\nЭто способствует более эффективному потреблению водных ресурсов и сокращению объемов использования наиболее агрессивных химикатов\r\n\r\nПодкладка: 100% хлопок, Основной материал: 100% хлопок.', 1, 1, 1),
(36, 'Кроп-топ кремового цвета The North Face эксклюзивно на ASOS', 19, 1679318, 1590, 2, 'ASOS DESIGN', '', 'Мягкий дышащий трикотаж\r\nТкань для футболок\r\n\r\nОсновная часть: 100% хлопок', 0, 1, 1),
(37, 'Сумка из натурального ротанга ASOS DESIGN', 19, 1587209, 2790, 6, 'ASSOC', '', 'Структурированный ротанг\r\nДля текстурного разнообразия\r\n\r\nОсновная часть: 100% ротанг. Подкладка: 100% полиэстер. Ручка: 100% полиуретан.', 1, 1, 1),
(38, 'Джоггеры в стиле oversized темного сине-зеленого цвета ASOS DESIGN Petite', 19, 1734415, 2190, 3, 'Petite', '', 'Мягкий трикотаж\r\nСтиль и комфорт - образ жизни\r\n\r\nТкань: 65% хлопок, 35% полиэстер Отделка: 100% хлопок', 0, 0, 1),
(39, 'Черные джоггеры в стиле casual с присборенной талией The Couture Club', 19, 1602042, 3490, 5, 'The Couture Club', '', 'The Couture Club - это бренд необычной повседневной одежды. Этот стилевой бренд, базирующийся в Манчестере, предлагает ассортимент футболок, свитшотов и худи, которые отлично сочетаются даже с туфлями на каблуке. В его коллекции также имеются обновленные модели из денима с рваной отделкой, принтами логотипа и свободным кроем, что делает эти модели более оригинальными. Пришло время стать членом этого клуба!', 0, 0, 1),
(40, 'Леггинсы длиной до щиколотки с леопардовым принтом Nike Training Оne', 19, 2028367, 3790, 2, 'Nike', '', 'Мягкий эластичный трикотаж\r\nС использованием технологии Nike Dri-FIT\r\nУдаляет с кожи пот, а затем выводит его за пределы ткани и способствует быстрому испарению\r\nКак итог, кожа остается сухой и прохладной\r\n\r\nОсновная часть: 83% полиэстер, 17% эластан.', 0, 1, 1),
(41, 'Черный мягкий костюм узкого кроя из 100% шерсти ASOS DESIGN', 19, 1129365, 2690, 2, ' ASOS DESIGN', '', 'В моделях от ASOS DESIGN вы всегда выглядите остромодно вне зависимости от того, кто вы, откуда и чем занимаетесь. Эксклюзивно на ASOS наш универсальный бренд предлагает вам свою коллекцию, в том числе линии Plus (модели большого размера) и Tall (для высоких). Наш дизайн - ваш стиль.', 1, 1, 1),
(42, 'Темно-синий костюм в однотонную клетку New Look', 20, 1128670, 3090, 0, 'New Look', '', 'New Look является частью отличных британских брендов уличной моды ASOS, предопределяющих стиль будущего и всегда находящихся на пике популярности. Мужская коллекция New Look, предлагающая футболки с принтами, обувь, аксессуары и многое другое, навеяна классическими фильмами о бунтарском движении и сочетает в себе лучшие элементы непринужденного стиля.', 0, 0, 1),
(43, 'Темно-бежевый пиджак скинни New Look', 20, 683364, 2190, 2, 'New Look', '', 'New Look является частью отличных британских брендов уличной моды ASOS, предопределяющих стиль будущего и всегда находящихся на пике популярности. Мужская коллекция New Look, предлагающая футболки с принтами, обувь, аксессуары и многое другое, навеяна классическими фильмами о бунтарском движении и сочетает в себе лучшие элементы непринужденного стиля.', 0, 1, 1);
INSERT INTO `product` (`id`, `name`, `category_id`, `code`, `price`, `availability`, `brand`, `image`, `description`, `is_new`, `is_recommended`, `status`) VALUES
(45, 'Светло-бежевый узкий галстук и платок для пиджака с цветочным рисунком ASOS DESIGN', 21, 1563832, 1090, 0, 'ASOS DESIGN', , 'Плотная ткань\r\nСделано из переработанного полиэстера\r\nПластиковые бутылки и текстильные отходы перерабатываются в пластиковые пластинки и переплавляются в новые волокна\r\nЭто экономит воду и энергию, а также сокращает выбросы парниковых газов\r\n\r\nМатериал: 100% полиэстер', 0, 0, 1);
